import './App.css';
import axios from "axios";
import React, { useState, useEffect } from "react";



const UserProfile = () => {

  const [userProfile, setUserProfile] = useState([]);

  const fetchUserProfile = () => {

    axios.get("http://localhost:8080/api/v1/users/1").then(res => {
      console.log(res);
      setUserProfile(res.data);
    });

  }

  useEffect(() => {
    fetchUserProfile();
  }, []);


  return (
    <div>
      <h2>UserID</h2>
      <div>{userProfile.username}</div>
    </div>

  );

};


function App() {
  return (
    <div className="App">
      <UserProfile />
    </div>
  );
}

export default App;
